import React from "react";
import Tabbar from "./Tabbar/Tabbar";
import Home from "./Home/Home";

function App() {
  return (
    <div className="container">
      <div className="navbar-holder">
        <Tabbar />
      </div>
      <Home />
    </div>
  );
}

export default App;
